A porta com escotilha é composta por um visor instalado na folha lisa e é utilizada quando se deseja ver no interior do ambiente sem precisar abrir a porta.
As escotilhas para portas de cozinha e lavanderia são um acessório super funcional, atendem o princípio da porta vai e vem, possibilitando a sua abertura nos dois sentidos sem o uso das mãos, sendo conveniente especialmente quando é necessário servir à mesa. Ao mesmo tempo são práticas, pois permitem que você mantenha a porta fechada, separando os ambientes mas sem perder a visão do que acontece em seu interior, evitando acidentes.

As portas com escotilhas são super modernas, podem ter uma ou mais escotilhas, e também com diferentes tamanhos, e você pode definir a posição de cada escotilha, como é o caso deste projeto, onde a porta de correr foi substituída pela porta com tripla escotilha, provocando um aspecto decorativo e funcional. Inegavelmente dando originalidade ao espaço.
É possível encontrar alguns modelos de porta como a da imagem, com a escotilha já instalada. 

